            <Item_Name_Town titre={test}/>
            <Tag />
          </div>
          <div className="vendor-information">
            <Vendor_info/>
            <Rate />
          </div>
        </section>

        <section className="item-description">
          <MenuComposant />
          <MenuComposant />
        </section>

        <h1>

</h1>
      </div>

    );
  }
}

export default FicheLogement;
